MENUDO ÑORDO!!!

@WINGEDPXWER Señaló la sien con el índice de la mano libre haciendo referencia al seso.—Llámale sexto sentido angelical.
Al volver a la postura se desvanecieron en una breve llamarada que los abarcó a ambos.
El viaje fue apenas perceptible; pero cuando el fuego se disipó ya se hallaban &gt;

@Tancerca_ Es que me falta sentido del humor y lo interpretó en el sentido literal.
Lo que me pasa es que cuando me he confiado y no me he guiado por mis impresiones o intuiciones, por el  sexto sentido, me la han liado y a veces gorda.
Me he vuelto desconfiado la verdad.
